#
# Structure for table "library_withdraw"
#

DROP TABLE IF EXISTS `library_withdraw`;
CREATE TABLE `library_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code_withdraw` varchar(255) NOT NULL DEFAULT '',
  `title` varchar(255) NOT NULL DEFAULT '',
  `label` enum('1','2','3','4','5','6','7') NOT NULL DEFAULT '1',
  `cash` enum('2500','5000','7500','10000','15000','20000','25000') NOT NULL DEFAULT '2500',
  `coin` int(11) NOT NULL DEFAULT '0' COMMENT 'coin > cash',
  `fee` int(11) NOT NULL DEFAULT '0' COMMENT '%',
  `status` enum('disable','enable') NOT NULL DEFAULT 'disable',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `Lock` (`label`),
  UNIQUE KEY `Withdraw Key` (`code_withdraw`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;

